import React from 'react';
import './Commands.css'
import { Card } from 'semantic-ui-react'
import commands from './Command';
import { CopyToClipboard } from 'react-copy-to-clipboard';

var STR = String()

commands.forEach(function (item) {
  STR += `${item.header} : ${item.header}\n`
})

function Button() {
  return (
    <CopyToClipboard text={STR} onCopy={() => this.setState({ copied: true })}></CopyToClipboard>
  )
}

function Commands() {
  return (
    <div className='Commands'>
      <Card.Group items={commands} className='CommandsCard' />
    </div >
  );
}

export default Commands;
